import {
  DIRECTION_RIGHT,
  CELL_SIZE,
  DIRECTION_LEFT,
  DIRECTION_UP,
} from "../helpers/consts";

export class Placement {
    constructor(properties, level) {
      this.id = properties.id;
      this.type = properties.type;
      this.x = properties.x;
      this.y = properties.y;
      this.level = level;
    }

    tick() { }
  
    renderComponent() {
      return null;
    }
  }
